    CriteriaEvaluationComponent.prototype.GetAllProjectList = function () {
        var _this = this;
        this.ProjectSelectionList = [];
        this.criteriaEvalService
            .GetAllProjectList(this.appurl.getApiUrl() + src_app_shared_global__WEBPACK_IMPORTED_MODULE_2__["GLOBAL"].API_Project_GetAllProjectList)
            .subscribe(function (data) {
            if (data != null) {
                if (data.data.ProjectDetailModel != null) {
                    data.data.ProjectDetailModel.forEach(function (element) {
                        _this.ProjectSelectionList.push({
                            value: element.ProjectId,
                            label: element.ProjectName
                        });
                    });
                }
            }
        });
    };
