    //#region "add" target benificiary
    CriteriaEvaluationComponent.prototype.addtargetBeneficiaryTypes = function (model) {
        var _this = this;
        var obj = {};
        var index = model._index;
        var TargetType = model.TargetType;
        // error handling
        if (TargetType === this.Age_ID) {
            this.AgeGroupList[index]._error = false;
        }
        else if (TargetType === this.Occupation_ID) {
            this.OccupationList[index]._error = false;
        }
        obj = {
            TargetId: model.TargetId,
            TargetType: model.TargetType,
            ProjectId: this.ProjectId,
            TargetName: model.TargetName
        };
        this.criteriaEvalService
            .AddEditTargetBeneficiary(this.appurl.getApiUrl() + src_app_shared_global__WEBPACK_IMPORTED_MODULE_2__["GLOBAL"].API_Project_AddEditTargetBeneficiary, obj)
            .subscribe(function (data) {
            if (data.StatusCode === 200) {
                if (TargetType === _this.Age_ID) {
                    _this.AgeGroupList[index].TargetId = data.CommonId.LongId;
                }
                else if (TargetType === _this.Occupation_ID) {
                    _this.OccupationList[index].TargetId = data.CommonId.LongId;
                }
            }
            else if (data.StatusCode === 400) {
                _this.toastr.error(data.Message);
            }
        }, function (error) {
            // error handling
            if (TargetType === _this.Age_ID) {
                _this.AgeGroupList[index]._error = true;
            }
            else if (TargetType === _this.Occupation_ID) {
                _this.OccupationList[index]._error = true;
            }
            _this.toastr.error('Something went wrong ! Try Again');
        });
    };
