    //#region to check the isCriteiaEvaluationSUBMIT
    CriteriaEvaluationComponent.prototype.OnCriteriaEvaluationSubmitChange = function (ev) {
        if (this.ProjectId != null) {
            if (ev === 'IsCESubmit') {
                this.startCriteriaEvaluationSubmitLoader = true;
                this.IsSubmitCEform.IsCriteriaEvaluationSubmit = true;
            }
            else if (ev === 'IsCEReject') {
                this.startCriteriaEvaluationSubmitLoader = true;
                this.IsSubmitCEform.IsCriteriaEvaluationSubmit = false;
            }
            this.setHeaderMenu();
            this.IsSubmitCEform.ProjectId = this.ProjectId;
            this.AddIsSubmitCEDetail(this.IsSubmitCEform);
        }
    };
    //#endregion
    //#region "setHeaderMenu"
    CriteriaEvaluationComponent.prototype.setHeaderMenu = function () {
        this.isSuperadmin = this.localStorageService.GetSuperAdminDetail();
        if (this.isSuperadmin) {
            this.globalService.setMenuList(this.menuList);
            // check weather the criteria evaluation is approved and project is win
        }
        else if (this.IsSubmitCEform.IsCriteriaEvaluationSubmit === true) {
            // check weather the criteria evaluation is approved
            this.authorizedMenuList = this.localStorageService.GetAuthorizedPages(this.IsSubmitCEform.IsCriteriaEvaluationSubmit
                ? this.menuList.filter(function (i, index) { return index < 3; })
                : this.menuList.filter(function (i, index) { return index < 2; }));
            // Set Menu Header List
            this.authorizedMenuList.push(this.menuList.find(function (r) { return r.Id === 7; }));
            this.globalService.setMenuList(this.authorizedMenuList);
        }
        //#endregion
    };
    //#region AddIsDeletedEligibilityDetail
    CriteriaEvaluationComponent.prototype.AddIsSubmitCEDetail = function (model) {
        var _this = this;
        var obj = {
            IsCriteriaEvaluationSubmit: model.IsCriteriaEvaluationSubmit,
            ProjectId: model.ProjectId
        };
        // this.commonLoader.showLoader();
        this.criteriaEvalService
            .AddIsCriteriaEvaluationSubmit(this.appurl.getApiUrl() + src_app_shared_global__WEBPACK_IMPORTED_MODULE_2__["GLOBAL"].API_Project_IsCriteriaEvaluationSubmit, obj)
            .subscribe(function (response) {
            if (response.StatusCode === 200) {
                _this.startCriteriaEvaluationSubmitLoader = false;
                _this.IsSubmitCEform.IsCriteriaEvaluationSubmit =
                    response.CommonId.IsApproved;
                _this.isCriteriaEvaluationFormSubmit.emit(_this.IsSubmitCEform.IsCriteriaEvaluationSubmit);
            }
            // this.commonLoader.hideLoader();
        }, function (error) {
            // this.commonLoader.hideLoader();
        });
    };
