        var _this = this;
        if (data.value != null) {
            this.sectorListFlag = true;
            var sectorModel = {
                SectorName: data.value,
                ProjectId: this.ProjectId
            };
            if (sectorModel.SectorName !== undefined &&
                sectorModel.SectorName !== '' &&
                sectorModel.SectorName !== ' ' &&
                sectorModel.SectorName !== null) {
                this.projectListService
                    .AddSectorDetail(this.appurl.getApiUrl() + src_app_shared_global__WEBPACK_IMPORTED_MODULE_6__["GLOBAL"].API_Project_AddSectorDetails, sectorModel)
                    .subscribe(function (response) {
                    if (response.StatusCode === 200) {
                        _this.sectorListFlag = false;
                        _this.GetAllSectorList();
                        // this.toastr.success('Sector Added Successfully!!!', 'action');
                        // duration: 3000,
                        // });
                        // this.Sector = [];
                    }
                    if (response.StatusCode === 420) {
                        _this.toastr.warning('Sector is allready exists in list');
                        _this.sectorListFlag = false;
                    }
                    if (response.StatusCode === 400) {
                        _this.toastr.error(response.Message);
                        _this.sectorListFlag = false;
                    }
                    if (response.StatusCode === 501) {
                        _this.toastr.warning(response.Message);
                        _this.sectorListFlag = false;
                    }
                }, function (error) {
                    _this.toastr.error('Something went wrong ! Please try again');
                    _this.sectorListFlag = false;
                });
            }
            else {
                this.sectorListFlag = false;
                this.toastr.warning('Please check sector name');
            }
        }
        else {
            this.toastr.warning('Please add new sector');
            this.sectorListFlag = false;
        }
